import React, { useState } from 'react';
import BlankPage from './BlankPage';
import './WelcomePage.css'; // Import CSS file for styling

function WelcomePage() {
  const [goToBlankPage, setGoToBlankPage] = useState(false); // State to track whether to go to the blank page

  const handleClick = () => {
    // Set goToBlankPage to true when button is clicked
    setGoToBlankPage(true);
  };

  if (goToBlankPage) {
    return <BlankPage onBack={handleClick} />; // Pass handleClick as the onBack prop
  }

  return (
    <div className="welcome-container">
      <h2>Welcome, Ana!</h2>
      <p>You are now logged in.</p>
      <button onClick={handleClick}>Go to Blank Page</button>
    </div>
  );
}

export default WelcomePage;
